$(function(){
  var distance = 300, speed = 300, opacity = 0.5;
  $('.contact_square').hoverIntent({
    over: function(){
      var package = $(this).find('.cs_header, .cs_shadow, .cs_content');
      var package2 = package.slice(3,6);
      if (package2.length == 0) {
        package2 = package.clone().insertAfter(package.eq(2));
        package2.slice(0,2).css({ left: -distance, opacity: opacity });
        package2.slice(2,3).css({ left: distance, opacity: opacity });
      }
      package = package.slice(0,3);
      package.slice(0,2).animate({ left: distance, opacity: opacity }, speed);
      package.slice(2,3).animate({ left: -distance, opacity: opacity }, speed);
      package2.slice(0,2).animate({ left: 0, opacity: 1 }, speed);
      package2.slice(2,3).animate({ left: 0, opacity: 1 }, speed);
    },
    out: function(){
      var package = $(this).find('.cs_header, .cs_shadow, .cs_content');
      package.slice(0,2).animate({ left: 0, opacity: 1 }, speed);
      package.slice(2,3).animate({ left: 0, opacity: 1 }, speed);
      package.slice(3,5).animate({ left: -distance, opacity: opacity }, speed);
      package.slice(5,6).animate({ left: distance, opacity: opacity }, speed);
    },
    timeout: 0,
    interval: 20
  });
});
